function AjaxGetPortalOrganisations(){this.hasUsersInRole=this.portalId=null;this.getPortalId=function(){return this.portalId};this.setPortalId=function(a){this.portalId=a};this.setHasUsersInRole=function(a){this.hasUsersInRole=a};this.ajax=function(){return $.ajax({url:"/api/getPortalOrganisations/"+this.getPortalId(),type:"post",dataType:"json",cache:!1,data:{CSRF_SESSION_TOKEN:CSRF_SESSION_TOKEN,hasUsersInRole:this.hasUsersInRole}})};this.fetch=function(){return this.ajax()}}
function AjaxAdminSearchOrganisations(){this.pageNumber=1;this.postData=null;this.setPostData=function(a){this.postData=a};this.getPostData=function(){return this.postData};this.getPageNumber=function(){return this.pageNumber};this.setPageNumber=function(a){"undefined"!==typeof a&&(this.pageNumber=a)};this.ajax=function(){return $.ajax({type:"POST",url:"/items/AjaxSearchOrgs/"+this.getPageNumber(),dataType:"json",data:this.getPostData()})};this.fetch=function(){return this.ajax()}};
